  `amount` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `spend_by` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `trash` tinyint(11) NOT NULL DEFAULT 0,
